// src/index.js

import React from "react";
import ReactDOM from "react-dom";
import { Auth0Provider } from "@auth0/auth0-react";
import { FavoritesProvider } from "./components/FavoritesContext"; // o FavoritesFromComponent
import App from "./App";

const domain = "dev-757jqha3ylhymbpr.us.auth0.com";
const clientId = "your-client-id"; // Reemplaza con tu client ID de Auth0

ReactDOM.render(
  <Auth0Provider
    domain={domain}
    clientId={clientId}
    authorizationParams={{ redirect_uri: window.location.origin }}
  >
    <FavoritesProvider>
      <App />
    </FavoritesProvider>
  </Auth0Provider>,
  document.getElementById("root")
);
